// import React, { useState, useEffect } from 'react';
import { motion } from "framer-motion";
import { Container, DarkWipe, LightWipe } from './WipeElements';

const Wipe = ({ themeToggleStatus }) => {
    return (
        <Container>
            <DarkWipe
                as={motion.div} 
                initial={{ opacity: 1, y: '0vh' }} 
                animate={(currPage == '') ? {  opacity: 0, y: '-100vh' } : { opacity: 1, y: '0vh' }}
                transition={{
                type: "tween",
                ease: [0.28, 1.35, 1.5, .91],
                duration: 0.3
                }}
            >
            </DarkWipe>
            <LightWipe
                as={motion.div} 
                initial={{ opacity: 1, y: '0vh' }} 
                animate={(currPage == '') ? {  opacity: 0, y: '-100vh' } : { opacity: 1, y: '0vh' }}
                transition={{
                type: "tween",
                ease: [0.28, 1.35, 1.5, .91],
                duration: 0.3
                }}
            >
            </LightWipe>
        </Container>
    );
};

export default Wipe;
